import React,{useState,useEffect} from "react";
import { useNavigate } from "react-router";
import "./childComponents.css";

const AllJobsUserProfile = ({fetchAllJobs,storage}) => {
    const [jobs,setJobs] = useState([]);
    const navigate = useNavigate('');

    useEffect(() => {
        loadJobs();
    },[])

    const loadJobs = async() => {
        const response = await fetchAllJobs();
        // if (response.length !== 0){
            setJobs(response);
        // }
    }

    const handleClickJob = async(jobId) => {
        storage.setItem("jobId",jobId);
        navigate();
    }
    return (
        <>
        <div>
        <button onClick={(e) => navigate("/signed-in/feed/") } className="back-button">Back</button>
        {jobs.map((job)=>(
            <li key={job.id} className="home-search-job-result-list"> 
            <button className="home-search-job-result-list-button " >
            <h3 className="title-job-home-screen-text">Job Title:</h3>
            <h4>{job.title}</h4>
            <h3 className="title-job-home-screen-text">Salary:</h3>
            <h4>${job.salary}/hr</h4>
            <h3 className="title-job-home-screen-text">Job Hours: </h3>
            <h4>{job.job_hours}</h4>
            </button>
            </li>
        ))}

        </div>
        </>
    )

}

export default AllJobsUserProfile;
